import React, { Component } from 'react';
import DetailPage from './DetailPage';
// import Axios from ‘axios’;

class FrontPage extends Component {

    // componentDidMount(){
    //     Axios.get(‘url’).then((response)=>{console.log(response)});
    //  }

    render() {
        return (
            <div>
                {/* navbar */}


                <nav className="navbar navbar-expand-md navbar-light sticky-top" style={{ background: "black" }}>
                    <div className="container-fluid">
                        {/* eslint-disable-next-line */}
                        <img src="/img/logo.png" ></img>
                        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive">
                            <span className="navbar-toggler-icon"></span>
                        </button>
                        <div className="collapse navbar-collapse" id="navbarResponsive">
                            <ul className="navbar-nav ml-auto">
                                <li className="nav-item">
                                    <button onClick={() => this.Registrationpage()} className="btn text-info btn-light  nav-link bg-dark m-1"><i className="fa fa-globe text-light p-1" aria-hidden="true"></i>Add Visitor</button>
                                </li>
                            </ul>
                        </div>
                        {/* {
                        this.state.show  ? <RegistrationForm /> : false
                    } */}

                    </div>
                </nav>

                {/* searchbar */}

                <nav className="navbar navbar-expand-md navbar-light sticky-top p-3" style={{ background: "black" }}>
                <div className="container-fluid">
                    <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarResponsive">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarResponsive">
                        <ul className="navbar-nav ml-auto">
                            <li className="nav-item">
                                <button className="btn-sm text-info btn-light  nav-link bg-dark m-1" style={{ width: "300px" }}><i className="fa fa-globe text-light p-1" aria-hidden="true"></i>Search</button>
                            </li>
                            <li className="nav-item active">
                                <input className="form-control nav-link m-1" placeholder="Search" style={{ width: "660px" }}></input>
                            </li>

                            <li className="nav-item">
                                <button className="btn text-info btn-light  nav-link bg-dark m-1 " style={{ width: "300px" }}>Clear</button>
                            </li>
                        </ul>
                    </div>

                </div>
            </nav>


                <div className="conatiner-fluid">
                    <div className="row">
                        <div className="col-7 bg-light border" style={{ height: "1200px" }}>
                            <div className="container-fluid padding">
                                <div className="row padding p-2" style={{ marginTop: "40px", border: "2px dotted yellow" }}>
                                    <div className="col-lg-5">
                                        {/* eslint-disable-next-line */}
                                        <img src="img/15.jpg" className="img-fluid" />
                                    </div>
                                    <div className="col-md-12 col-lg-5 text-light">
                                        <input type="text" className="form-control btn-sm p-1 m-1 col-8" placeholder="Enter Name" />
                                        <input type="emil" className="form-control btn-sm p-1 m-1 col-8" placeholder="Enter Email" />
                                        <input type="number" className="form-control p-1 btn-sm m-1 col-8" placeholder="Enter Number" />
                                    </div>
                                    <div className="col-lg-2">
                                        <button type="button" class="btn btn-primary btn-circle btn-xl p-4 m-4">Approved</button>
                                    </div>
                                </div>
                            </div>
                        </div>
                        <div className="col-5 bg-light border">
                            sjfkejghghh
                    </div>
                    </div>

                </div>
            </div>
        );
    }
}

export default FrontPage;
